import {API} from "../../backend";

export const getProduct = (productId) => {
    return fetch(`${API}/product/${productId}`, {
        method: "GET",
        headers: {
            Accept: "application/json"
        }
    })
    .then((data) => {return console.log(data.json())})
    .catch((error) => console.log(error))
}
